import React from 'react';
import Data from './Data.jsx'
import Html from './Html'





// App Netflix

const App = ()=>(
    <>
    {Data.map((val)=>{
         return(
            <Html
            key = {val.id}
            imgsrc = {val.imgsrc}
            title = {val.title}
            link = {val.link}
            />
        )
   })}
    </>
)

export default App;
